import Facebook_icon from '../images/Facebook.svg';
import Google_icon from '../images/google.svg';


const ReviewsData = [
{
    person_name : 'Shonu Bhasin',
    rating: '4',
    content: `My daughter told me about this... I tried it and it was of great help as a time consuming chore was done for me. Very professional. Loved it.`,
    brand_img: Google_icon,
},
{
    person_name : 'Dave Sullivan',
    rating: '5',
    content: 'Used them for the first time absolutely awesome. These guys should teach customer service. Will use them from now on on a regular basis highly recommend them.',
    brand_img: Facebook_icon,
}
]

export default ReviewsData;
